import React from "react";

const Nav = () => {
  return (
    <nav>
      <ul>
        <li>
          <a href="sass.html" class="col s12 m4 l4">
            Sass
          </a>
        </li>
        <li>
          <a href="badges.html" class="col s12 m4 l4">
            Components
          </a>
        </li>
        <li>
          <a href="collapsible.html" class="col s12 m4 l4">
            JavaScript
          </a>
        </li>
      </ul>
    </nav>
  );
};

export default Nav;
